export const Services = () => {
  const services = [
    {
      id: 1,
      servicesTitle: 'Landing Pages',
      services: [
        {id: 1, serviceName: 'Landing Page One'},
        {id: 2, serviceName: 'Landing Page two'},
        {id: 3, serviceName: 'Landing Page three'},
      ]
    }
  ]
  return (
  <div className="flex flex-col h-screen items-center justify-center p-10">
      {
        services.map((service) => (
      <div key={service.id} className="flex flex-col gap-8 text-sm">
        <h1 className="font-bold text-lg">{service.servicesTitle}</h1>
        <div className="flex flex-wrap gap-10">
          {
            service.services.map((s) => (
            <div key={s.id} className="bg-red-500 w-full">
              {s.serviceName}
            </div>
            ))
          } 
        </div>
      </div>
        ))
      }

  </div>
  )
}
